import React from 'react';
import styled from 'styled-components';
import { BlotterText } from './BlotterText';

const CommunitySection = styled.section`
  min-height: 100vh;
  width: 100%;
  padding: 4rem 2rem;
  background: var(--background);
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const SectionTitle = styled.div`
  text-align: center;
  margin-bottom: 4rem;
`;

const ContentContainer = styled.div`
  max-width: 1200px;
  width: 100%;
  margin: 0 auto;
`;

const StatsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  gap: 2rem;
  margin-bottom: 4rem;

  @media (max-width: 768px) {
    grid-template-columns: 1fr;
  }
`;

const StatCard = styled.div`
  background: rgba(255, 255, 255, 0.05);
  border-radius: 12px;
  padding: 2rem;
  text-align: center;
  transition: transform 0.3s ease;

  &:hover {
    transform: translateY(-5px);
  }
`;

const StatValue = styled.div`
  font-size: 2.5rem;
  font-weight: bold;
  color: var(--accent);
  margin-bottom: 1rem;
`;

const StatLabel = styled.div`
  color: rgba(255, 255, 255, 0.7);
  font-size: 1.2rem;
`;

const JoinSection = styled.div`
  text-align: center;
  margin-top: 4rem;
`;

const JoinDescription = styled.p`
  color: rgba(255, 255, 255, 0.9);
  font-size: 1.2rem;
  line-height: 1.6;
  max-width: 800px;
  margin: 0 auto 2rem;
`;

const TelegramButton = styled.a`
  display: inline-flex;
  align-items: center;
  padding: 1rem 2rem;
  font-size: 1.2rem;
  border: none;
  border-radius: 8px;
  background: var(--accent);
  color: var(--background);
  text-decoration: none;
  transition: all 0.3s ease;
  font-weight: bold;

  &:hover {
    transform: translateY(-2px);
    opacity: 0.9;
  }

  &::before {
    content: 'ðŸ“±';
    margin-right: 0.5rem;
    font-size: 1.4rem;
  }
`;

const stats = [
  { value: '10K+', label: 'Squanchers' },
  { value: '1M+', label: 'Messages Sent' },
  { value: '100K+', label: 'AI Interactions' }
];

export const Community: React.FC = () => {
  return (
    <CommunitySection id="community">
      <SectionTitle>
        <BlotterText 
          text="Join the Squanchiverse!"
          fill="rgba(255, 255, 255, 0.9)"
        />
      </SectionTitle>

      <ContentContainer>
        <StatsGrid>
          {stats.map((stat, index) => (
            <StatCard key={index}>
              <StatValue>{stat.value}</StatValue>
              <StatLabel>{stat.label}</StatLabel>
            </StatCard>
          ))}
        </StatsGrid>

        <JoinSection>
          <JoinDescription>
            Ready to get squanchy with it? Join our vibrant Telegram community where memes flow like quantum particles and every day is an interdimensional adventure!
          </JoinDescription>
          <TelegramButton 
            href="https://t.me/SquanchCoin" 
            target="_blank" 
            rel="noopener noreferrer"
          >
            Join Telegram
          </TelegramButton>
        </JoinSection>
      </ContentContainer>
    </CommunitySection>
  );
};
